Removed comma expressions

These made me scratch my head:

>  lt = ord[i] !== 'descending' ? (gt=1, -1) : (gt=-1, 1);
>  if (c === '.' && !b) (j > i) ? push() : (i = j + 1);
>  test.equal(s, (1,eval)(vega.stringValue(s)));

The last one is still puzling...

Add "name" as required property to ScaleRef

Otherwise the `parallel_coords.json` example is ambiguous:

```json
              "y": {
                "scale": {"datum": "data"},
                "field": {"parent": {"datum": "data"}}
              }
```
